import React,{useState} from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView,Picker,TextInput} from 'react-native';
import {css} from '../assets/Css/css';
import DatePicker from 'react-native-date-picker'


export default function Teste1 (props1) {
    const [selectedValue1, setSelectedValue1] = useState('Bovespa')
    const [selectedValue2, setSelectedValue2] = useState('Bovespa')
    const [selectedDate,setSelectedDate] = useState(null);
    const DatePickerWrapperStyles = createGlobalStyle`
    .date_picker.full-width {
        width: 100%;
    }
`;
    
    return (
        <SafeAreaView style = {css.fundo}>
        
            <View style = {css.login_form}>
                <Picker selectedValue1={selectedValue1} style={{ height: 50, width: 150 }} onValueChange={(itemValue1, itemIndex1) => setSelectedValue1(itemValue1)}>
                    <Picker.Item label="Bovespa" value="^BVSP" />
                    <Picker.Item label="Dow Jones Industrial Average" value="^DJI" />	
                    <Picker.Item label="NASDAQ Composto" value="^IXIC" />
                </Picker>
                <Picker selectedValue2={selectedValue2} style={{ height: 50, width: 150 }} onValueChange={(itemValue2, itemIndex2) => setSelectedValue2(itemValue2)}>
                    <Picker.Item label="Banco do Brasil" value="BBAS3.SA" />
                    <Picker.Item label="Petrobras" value="PETR4.SA" />	
                    <Picker.Item label="Vale" value="VALE5.SA" />
                </Picker>
                    <DatePicker selected ={selectedDate} wrapperClassName='date_picker full-width' onChange = {date=>setSelectedDate(date)} value = {selectedDate} id = 'data' dateFormat = "dd/MM/yyyy" placeholderText =  'Data de Referência' />
                    <DatePickerWrapperStyles/>
            </View>
            <View>
                <TouchableOpacity title = "Predição" onPress={()=>props1.navigation.navigate('Preditor2')} style = {css.login_button}><Text style = {css.login_buttonText}>Preditor2</Text> </TouchableOpacity>
            </View>
        </SafeAreaView>
    );
    
}
